import React from "react";
import Header from "./Header";
import Card from "./Card";

function Main({cards}) {
  

  return (
    <>
      <Header />
      <main className="content">
      <section className="elements">
      <article className="element">
            <button className="element__add-button" />
        </article>
        {cards.map((card) => {
          return (
            <Card/>
          );
        })}
      </section>
    </main>
    <model-viewer 
      className="model-viewer" 
      src="../vendor/models/bathroom/bathroom2.glb" 
      alt="A rock"
      exposure="0.008"
      camera-controls
      ar
      ar-modes="webxr">
    </model-viewer>
    </>
  );
}

export default Main;
